import React from 'react';
import './Switcher.css';
function Switcher()
{
    return (
        <div className="style-switcher">
        <h5>Style Switcher</h5>
        <ul>
            <li>
                <a href="a" title="pink" style={{backgroundColor:"#ec1839"}}>pINK</a>
            </li>
            <li>
                <a href="a" title="blue" style={{backgroundColor:"#2196f3"}}>A</a>
            </li>
            <li>
                <a href="a" title="orange" style={{backgroundColor:"#fa5b0f"}}>a</a>
            </li>
            <li>
                <a href="a" title="yellow" style={{backgroundColor:"#ffb400"}}>a</a>
            </li>
            <li>
                <a href="a" title="green" style={{backgroundColor:"#72b626"}}>a</a>
            </li>
        </ul>
    </div>
    );
}
export default Switcher;
